    P0,

    /// Priority 1: Lowest active priority
    P1,

    /// Priority 2
    P2,

    /// Priority 3
    P3,

    /// Priority 4
    P4,

    /// Priority 5
    P5,

    /// Priority 6
    P6,

    /// Priority 7: Highest priority
    P7,
